import React, {Component} from 'react';
import './Background.css';
import MousePosition from '../MousePosition/MousePosition';

class Background extends Component{
    constructor(props){
        super(props);
        this.state = {
            x:0,
            y:0,
            linhas:"",
            funcaoClick: null,
            funcaoFim: null,
            posicoes: [],
            objetos: [],
            objetosJSX: []
        };

        this.mouseMoveEvent = this.mouseMoveEvent.bind(this);
        this.mouseClickEvent = this.mouseClickEvent.bind(this);
        this.detectKeyFunction = this.detectKeyFunction.bind(this);
        this.salvarPosicoes = this.salvarPosicoes.bind(this);
        this.gerarObjeto = this.gerarObjeto.bind(this);
        this.gerarObjetoSemInicio = this.gerarObjetoSemInicio.bind(this);
    }

    mouseMoveEvent(e){
        this.setState({ x: e.pageX, y: e.pageY });
    }

    mouseClickEvent(e){
        if(this.state.funcaoClick !== null){
            let funcao = this.state.funcaoClick;
            funcao(e);
        }
    }

    detectKeyFunction(event){
        if(event.keyCode === 76) {
            if(this.state.funcaoClick===null){
                this.setState({ funcaoClick: this.salvarPosicoes });
            }else if(this.state.funcaoClick === this.salvarPosicoes){
                this.setState({ funcaoClick: null });
                this.gerarObjeto(this.state.posicoes);
            }
        }else
        if(event.keyCode === 75) {
            if(this.state.funcaoClick===null){
                this.setState({ funcaoClick: this.salvarPosicoes });
            }else if(this.state.funcaoClick === this.salvarPosicoes){
                this.setState({ funcaoClick: null });
                this.gerarObjetoSemInicio(this.state.posicoes);
            }
        }
    }

    salvarPosicoes(event){
        this.state.posicoes.push(
                    {
                        x: Math.round(event.pageX/20)*20,
                        y: Math.round(event.pageY/20)*20
                    }
                );
    }

    gerarObjeto(posicoes){
        let s = "";
        if(posicoes.length >1){
            for(let i = 0; i < posicoes.length; i++){
                let atual = posicoes[i];
                if(i === 0){
                    let prox = posicoes[i+1];
                    if(prox.x === atual.x){
                        if(prox.y>atual.y){
                            s+="M"+atual.x+" "+(atual.y+4);
                        }else{
                            s+="M"+atual.x+" "+(atual.y-4);
                        }
                    }else if(prox.y === atual.y){
                        if(prox.x>atual.x){
                            s+="M"+(atual.x+4)+" "+atual.y;
                        }else{
                            s+="M"+(atual.x-4)+" "+atual.y;
                        }
                    }else{
                        if(prox.x > atual.x){
                            if(prox.y>atual.y){
                                s+="M"+(atual.x+3)+" "+(atual.y+3);
                            }else{
                                s+="M"+(atual.x+3)+" "+(atual.y-3);
                            }
                        }else{
                            if(prox.y>atual.y){
                                s+="M"+(atual.x-3)+" "+(atual.y+3);
                            }else{
                                s+="M"+(atual.x-3)+" "+(atual.y-3);
                            }
                        }
                    }
                }else if(i === posicoes.length-1){
                    let ant = posicoes[i-1];
                    if(ant.x === atual.x){
                        if(ant.y>atual.y){
                            s+=" L"+atual.x+" "+(atual.y+4);
                        }else{
                            s+=" L"+atual.x+" "+(atual.y-4);
                        }
                    }else if(ant.y === atual.y){
                        if(ant.x>atual.x){
                            s+=" L"+(atual.x+4)+" "+atual.y;
                        }else{
                            s+=" L"+(atual.x-4)+" "+atual.y;
                        }
                    }else{
                        if(ant.x > atual.x){
                            if(ant.y>atual.y){
                                s+=" L"+(atual.x+3)+" "+(atual.y+3);
                            }else{
                                s+=" L"+(atual.x+3)+" "+(atual.y-3);
                            }
                        }else{
                            if(ant.y>atual.y){
                                s+=" L"+(atual.x-3)+" "+(atual.y+3);
                            }else{
                                s+=" L"+(atual.x-3)+" "+(atual.y-3);
                            }
                        }
                    }
                }else{
                    s+=" L" + posicoes[i].x+" "+posicoes[i].y;
                }
            }
        }
        let temp = s;
        s = "<path d=\""+s+"\" fill=\"transparent\" stroke=\"#000\"></path>";
        s = "<circle cx=\""+posicoes[0].x+"\" cy=\""+posicoes[0].y+"\" r=\"4\" fill=\"transparent\" stroke=\"#000\"></circle>"
            +s
            + "<circle cx=\""+posicoes[posicoes.length-1].x+"\" cy=\""+posicoes[posicoes.length-1].y+"\" r=\"4\" fill=\"transparent\" stroke=\"#000\"></circle>"
        let sJSX = (<g>
                <circle cx={posicoes[0].x} cy={posicoes[0].y} r="4" fill="transparent" stroke="#000"></circle>
                <path d={temp} fill="transparent" stroke="#000"></path>
                <circle cx={posicoes[posicoes.length-1].x} cy={posicoes[posicoes.length-1].y} r="4" fill="transparent" stroke="#000"></circle>
            </g>);
        this.setState({posicoes: []});
        this.state.objetos.push(s);
        this.state.objetosJSX.push(sJSX);
        console.log(s);
    }

